import React from "react";
import { Container, Row, Col } from "shards-react";
import { Form, FormGroup, FormInput, FormRadio } from "shards-react";

class Daily extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      dailyRating: null,
    };

    this.changeRating = this.changeRating.bind(this);
  }

  changeRating(rating) {
    this.setState({
      dailyRating: rating,
    });
  }

  render() {
    return (
      <Container className="internalBlock">
        <Row>
          <Col>
            <h1>&#128171; Rating</h1>
          </Col>
        </Row>
        <Row>
          <Col>
            <Slider
              connect={[true, false]}
              start={[20]}
              range={{ min: 0, max: 100 }}
            />
          </Col>
        </Row>
        <Row>
          <Col>
            <h4>reason:</h4>
          </Col>
        </Row>
        <Row>
          <Col>
            <Form>
              <FormGroup>
                <FormInput id="#reason" placeholder="Reason" />
              </FormGroup>
            </Form>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Daily;
